targets.expr:
sum(
max (kube_pod_labels{label_tier=~"dundergitcall",label_owner_id=~"$owner_id",label_group_id=~"$group_id",service_id=~"$service_id"}) by (label_tier, pod)
    * 
    on(pod)

    group_right(label_tier)

    label_replace

    (avg by(pod,container)

      ( container_memory_working_set_bytes{container!="POD",container!="",image!=""}

    ), "pod", "$1", "pod_name", "(.+)"
  )
)

/ 

sum(
max (kube_pod_labels{label_tier=~"dundergitcall",label_owner_id=~"$owner_id",label_group_id=~"$group_id",service_id=~"$service_id"})
by (label_tier, pod)*on(pod)group_right(label_tier)
label_replace
(

(kube_pod_container_resource_limits_memory_bytes{}
), "pod", "$1", "pod", "(.+)")
)

* 100

sum(
max (kube_pod_labels{label_tier=~"dundergitcall-usercode",label_owner_id=~"$owner_id",label_group_id=~"$group_id",service_id=~"$service_id"}) by (label_tier, pod)
